import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Toggle from './Toggle';
import Volume from './Volume';
// import { useState, useEffect } from 'react'
const test = () =>{
  console.log("It is working");
}

const Body = () =>{
  return(
    <div className='container'>
      <div id='drum-machine'>
          {/* Creating the drum kit */}
          <div className='drum-kit'>
            <button className='drum-pad btn' id='heater-1'><p>P</p></button>
            <button className='drum-pad btn' id='heater-2'><p>W</p></button>
            <button className='drum-pad btn' id='heater'><p>E</p></button>
            <button className='drum-pad btn'><p>A</p></button>
            <button className='drum-pad btn'><p>S</p></button>
            <button className='drum-pad btn'><p>D</p></button>
            <button className='drum-pad btn'><p>Z</p></button>
            <button className='drum-pad btn'><p>x</p></button>
            <button className='drum-pad btn'><p>c</p></button>
          </div>

          {/* Creating the two toggle buttons, the screen and, the volume button*/}

          {/* power button */}
          <div className='toggle1'>
            <Toggle label="Power" toggled={true} onClick={test} />
          </div>

          {/* screen display */}
          <div id='display'>
            <p>volume: 55</p>
          </div>

          {/* volume slider */}
          <div className='volume-btn'>
            <Volume/>
          </div>


          {/* Bank button */}
          <div className='toggle2'>
            <Toggle label="Bank" toggled={false} onClick={test} />
          </div>


        </div>
      </div>
  )
}

const App = () => {
  return (
    <div>
      <Body />
    </div>
  )
}

export default App
